import React from 'react';
import ReactDOM from 'react-dom';

const curdate=new Date().toLocaleDateString();
const curtime=new Date().toLocaleTimeString();

const name="Kumar"
ReactDOM.render([<h1>Naveen {name} Technical Netflix Pick</h1>,<br></br>,<p>List of {Math.random()} Web Series</p>,<ol thype="1"><li>Dark</li><li>Extra Curricular</li><li>my holo love</li></ol>
,<p>current Date is:{curdate}</p>,<p>current Time is:{curtime}</p>
],document.getElementById("kumar"));
